  `shootTimes` int(11) NOT NULL DEFAULT '0' COMMENT '射击次数',
  `shootMissTimes` int(11) NOT NULL DEFAULT '0' COMMENT '未命中人的射击次数',
  `shootHitTimes` int(11) NOT NULL DEFAULT '0' COMMENT '射击命中人的人次',
