DROP TABLE IF EXISTS `brawl_map`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `brawl_map` (
  `id` int(10) NOT NULL COMMENT '乱斗唯一识别符',
  `name` varchar(200) NOT NULL COMMENT '乱斗名称',
  `map_id` int(10) NOT NULL COMMENT '从map表中读取id字段获取地图对战数据信息',
  `img_id` int(11) NOT NULL DEFAULT '0' COMMENT '乱斗入口图片',
  `hero_choose` int(10) NOT NULL DEFAULT '0' COMMENT '是否从所有英雄中选择:0=只选择已有英雄;1=所有英雄可以选择',
  `skin_open` int(10) NOT NULL DEFAULT '0' COMMENT '是否开放所有皮肤:1=全部拥有皮肤;0=只用默认皮肤',
  `part_open` int(10) NOT NULL DEFAULT '0' COMMENT '是否可以使用强化零件:1=使用;0=不使用',
  `limit_sex` int(10) NOT NULL DEFAULT '0' COMMENT '性别筛选:0=不限制;1=男性;2=女性',
  `limit_hero_cnt` int(10) NOT NULL DEFAULT '0' COMMENT '限制英雄的选择次数(0=不限制 >0 表示限制选择的次数)',
  `limit_gun_type` varchar(200) NOT NULL DEFAULT '' COMMENT '枪械类型筛选:填写枪械类型,可以为数组',
  `reborn_time` int(11) NOT NULL DEFAULT '0' COMMENT '复活时间',
  `limit_hero_id` varchar(200) NOT NULL DEFAULT '' COMMENT '英雄id筛选:填写英雄id,可以为数组',
  `hero_reborn_type` int(10) NOT NULL DEFAULT '0' COMMENT '英雄复活类型:0=复活原来英雄;1=复活随机其他英雄;2=复活玩家选择英雄',
  `atk_dmg_coefficient` int(11) NOT NULL COMMENT '普通攻击伤害系数，原damage字段，为万分比',
  `skill_dmg_coefficient` int(11) NOT NULL COMMENT '技能伤害系数，同上',
  `skill_cd_coefficient` int(11) NOT NULL COMMENT '技能CD系数，同上',
  `recovery_coefficient` int(11) NOT NULL COMMENT '影响血量恢复效果 万分比',
  `life_coefficient` int(11) NOT NULL COMMENT '血量上限系数，同上',
  `bullet_limit` int(11) NOT NULL COMMENT '子弹无限开关，1=子弹无限，0=默认',
  `sp_limit_type` int(10) NOT NULL DEFAULT '0' COMMENT '表示乱斗的特殊限定:0=不限定;1=道具限定',
  `sp_limit_type_parameter` varchar(200) NOT NULL DEFAULT '0' COMMENT '特殊限定的详细设定:道具限定时为限定道具ID,0=无限定',
  `inte_coefficient` int(11) NOT NULL DEFAULT '0' COMMENT '道具强度增加',
  `intro1` varchar(200) NOT NULL COMMENT '对局信息1',
  `intro2` varchar(200) NOT NULL COMMENT '对局信息2',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
